import React, { useEffect, useState, useContext} from 'react';
import RootContext from "../../providers/root";
import './home-page.css';
import axios from "axios";
import ClassroomIMG from "./classroom-stock.jpg"
import { RecordingMenu, Progress, History } from '../../components';

function HomePage() {
    const {
        setCurrentPage
    } = useContext(RootContext);

    const [menuSlide, setMenuSlide] = useState();

    const renderComponent = () => {
        switch (menuSlide) {
            case 'progress':
                return <Progress />;
            case 'history':
                return <Progress />;
            default:
                return <div>No component found</div>;
        }
    };

    useEffect(() => {
        renderComponent();  
    }, []);
    

    return (
        <div className='home'>
            <div class="main" style={{ backgroundImage: `url(${ClassroomIMG})` }}>
                <div className='overlay'></div>
                <RecordingMenu />
            </div>
            <div class="header">
                <ul>
                    <li className='title'><button onClick={() => setCurrentPage("")}>TeachSpeakAI</button></li>
                    <li><button><i class="gg-profile"></i></button></li>
                    <li><button><i class="gg-bell"></i></button></li>
                </ul>                
                </div>
                <div class="navigation">
                <ul>
                    <li><button className='active'><i class="gg-record"></i>Record Session</button></li>
                    <li><button onClick={() => setMenuSlide('progress')}><i class="gg-arrow-right-o"></i> Progress</button></li>
                    <li><button onClick={() => setMenuSlide('history')}><i class="gg-time"></i> History</button></li>
                    <li><button><i class="gg-shape-hexagon"></i>Settings</button></li>
                </ul>
            </div>
        </div>
    );
}

export default HomePage;
